import React from 'react';
import { NavLink } from 'react-router-dom';

const Nav = () => {
	return (
		<div>										
		    <nav>
			    <ul>
					<li>
					    <NavLink to='/'>
                        <img border="0" alt="logo" src="" width="100" height="100"/>
						Home
						</NavLink>
					 </li>
					 <li>
						 <h2>THe Authentic food</h2>
					 </li>
					 <li>
						 <NavLink to="/SignIn">
						 Sign In
						 </NavLink>
						 <NavLink to="/SignUp">
						 Sign Up
						 </NavLink>
					</li>

				</ul>

			</nav>	
		</div>
	);
};

export default Nav;
